description:
* Bán đất 3 mặt thoáng, vị trí Khu D9 Vườn Đào Lạc Long Quân Tây Hà Nội;
* Diện tích 380m2.
* Mặt tiền 20m, đất 3 mặt thoáng.
* Phù hợp xây biệt thự san vườn, hoặc đạt trụ sở văn phòng công ty;
* Vị trí trung tâm, gần 8 sở ban ngành, gần trung tâm quận Tây Hồ, gần trung thương mại Lotte Tây Hồ Hà Nội;
* Giao thông giao vói Lạc Long Quân, Võ Chí Công, Nguyễn Hoàng Tôn;
* Giá bán 230 triệu/m2 bằng 85 tỷ;
- LH xem nhà ngay Trần Đình Long.
- Miễn phí 100% xem nhà, tư vấn tận tâm cho khách đến khi mua được nhà, miễn tiếp trung gian.
